#include <bbqr/bbqr.hpp>
#include <format>
#include <iostream>
#include <string>

using namespace bbqr;

int main() {
  std::vector<std::string> lines = {
      R"(B$)",
      R"(B$)",
      R"(B$)",
      R"(B$)",
      R"(B$)",
      R"(B$)",
      R"(B$)",
      R"(B$)",
      R"(B$)",
  };

  try {
    JoinResult result = join_qrs<std::string>(lines);
    // JoinResult result = join_qrs(lines);
    if (result.is_complete) {
      std::cout << "result: " << result.raw << "\n";
    } else {
      std::cout << std::format("scan {} of {} QR\n", result.processed_parts_count, result.expected_part_count);
    }
  } catch (std::exception &e) {
    std::cout << "error " << e.what() << "\n";
  }
}
